script: |
  super -f text -I q9785.spq | sort > q9785.out

inputs:
  - name: q9785.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN - col1 + + - col0 AND ( - - col2 * + 63 * - - 61 * + col1 + + + 11 );
  - name: tab2

outputs:
  - name: q9785.out
    data: |
